import React from 'react'
import DeafualtImage from '../../assets/images/car-image.webp';
const UplodImage = () => {
  return (
    <div>
        <img src={DeafualtImage} alt="" className='w-full h-[100px] object-contain' />
        <button className='absolute top-2 right-2'><i class="fa-solid fa-trash"></i></button>
    </div>
  )
}

export default UplodImage
